import React from "react";

function Arrow(props) {
  return (
    <svg
      className={props.className}
      width="24"
      height="24"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
    >
      <path
        d="M12 24a12 12 0 100-24 12 12 0 000 24zm0-1a11 11 0 110-22 11 11 0 010 22zm5.293-12.293l-1.414-1.414L12 14.586l-3.879-3.88-1.414 1.414L12 17.414l5.293-5.293z"
        fill="#000"
      />
    </svg>
  );
}

export default Arrow;
